  namespace: SuperOffice.CRM.ArchiveLists
  summary: >-
    This interface defines an Archive Extender: A class that adds columns to an existing query. This interface is defined as the sum

    of its parents: <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderDoesExtend" data-throw-if-not-resolved="false"></xref> for the actual extension part, <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderHasColumns" data-throw-if-not-resolved="false"></xref>

    for the property of adding columns to the final result; <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderExtensible" data-throw-if-not-resolved="false"></xref> because extenders are themselves

    extensible and should be able to form chains; and <xref href="SuperOffice.Factory.IPlugin" data-throw-if-not-resolved="false"></xref> because extenders are added as plugins to their parents by

    the factory mechanism. Some extra functionality is also defined, that is an extension of the strict properties
  example: []
