    content: 'public interface IArchiveExtender : IArchiveProviderDoesExtend, IArchiveProviderHasColumns, IArchiveProviderExtensible'
    content.vb: Public Interface IArchiveExtender Inherits IArchiveProviderDoesExtend, IArchiveProviderHasColumns, IArchiveProviderExtensible
